description:
Using Electron Microscopes, scientists examine the traits of insects deep inside the Amazon. Treehoppers are amazing creatures with fantastical forms and impressive structures. For the very first time our cameras will travel with the world's most knowledgeable scientists in an amazing expedition to track these creatures. These mini-monsters are wild enough to scare any explorer, but brought down to scale, they are tiny vegetarian insects.


